    "descriptions": [
      {
        "type": "GENERAL",
        "value": "Traditional Victorian Hotel, fully renovated in 2011. All Public Areas have been restored to reveal the original marble and tiling dating back to 1861. All 347 rooms have been fully refurbished to a 4 star plus standard, complete with I pod docking stations and air conditioning in all rooms. Catering for all tastes, the hotel has an informal Brasserie, newly designed destination bar and top Cantonese Restaurant. Board Room Level Meeting Rooms Cater for 5  85 persons."
      },
      {
        "type": "DINING",
        "value": "The Brasserie is open throughout the day for breakfast lunch and dinner. Serves a wide variety of meals for all tastes, in an informal setting. Pre theatre menus available every night except Sundays. The Grand Imperial is a cantonese fine dining experience, inspired by Rand Cheung, one of Malaysias top chefs who is recreating his special east meets west menu in London. Express Lunches and Dim sum available daily. Groups welcome. \n\nON PROPERTY:\nReunion Bar\n Now one of the main attractions in the area, Reunion Bar is THE hot spot for the best cocktails ever! Stylish and chic, good music and  a great snack menu, it's the perfect place. This was originally the first-class waiting lounge for guests joining the Venice Simplon Orient Express, station views have remained in place as they were back then. Available for exclusive party hire on request.\n\nGrosvenor Arms\n\nThe Lounge\n Our Elegant Lounge is the perfect setting to enjoy our selection of our delicious afternoon teas or light meals. The Lounge has long been a central London meeting place for friends, family, or colleagues, any day or time of the week.\n\nGrand Imperial\n Everything about our new Grand Imperial fine dining restaurant is authentic, from the artwork to the exquisite Cantonese cuisine prepared by renowned chef and restaurateur Rand Cheung. Well on it's way to the deserved place as the best Cantonese restautnra in London, it's definitely worthy of a visit whether entertaining clients, or marking a special occasion, or for quick Dim Sum Lunchtime special! It also have a pricate for paties of 15 or more. \nOpen from lunchtime until late every day, Grand Imperial also has its own entrance from Buckingham Palace Road. \n\nOFF PROPERTY:\nThe Boisdale\nPopular scottish and jazz themed restaurant. Rave reviews. 5 mins from hotel. Open Monday to Saturday.\n\nEbury Street Wine Bar\nEccentric bar 5 mins from hotel. Amusing Dcor!  Food good. Nice staff. Open Monday to Sunday.\n"
      },
      {
        "type": "FACILITIES",
        "value": "** Please note the gym is closed until end of July 2019 due to renovations **\n24 hour reception, concierge and room service. BT wi fi internet connection available throughout the hotel. A modern, fully airconditioned gym with Precor equipment is available free of charge to all residents from 6 am to 10pm.  2 Bars, 2 restaurants and Club Lounge. \n\n2 Restaurant(s)               3 Lounge(s)                  \nAir Conditioning              Coffee Shop                  \nElevator                      Executive Floor              \nFront Desk Hours 0000-2359    Guest Laundry Facility       \nHotel Safe Deposit Box        Housekeeping                 \nRoom Air Filtration           Smoke Free Property          \nStorage Space Available       Year Built 1862              \nBuilding Meets Local, State and Country Building Codes\nMeets Americans with Disabilities Act of 1990 Specs\nPhysically Challenged Public Areas\nWater Purification System in Use\nYear Public Areas Refurbished Last 2012\n"
      },
      {
        "type": "RECREATION",
        "value": "** Please note the gym is closed until end of July 2019 due to renovations **\nReunion Cocktail and Champagne bar- is enjoyed by hotel guests, local executives and residents from Belgravia. Our new Grosvenor Tea Lounge serves a variety of tempting afternoon teas and lighter meals in a grandeur setting. Close by is Knightsbridge, Oxford Street, Hyde Park and not forgetting the closest of all, Buckingham Palace. The Apollo and Victoria theatres are within 2 minutes walk of the hotel.\n\nRecreations On Site\nCardio Vascular Equipment     Weight Lifting Equipment     \n\nRecreations Off Site\nExtensive Health Club         Limited Health Club          \nSpa                           Sun Bed                      \n"
      },
      {
        "type": "SERVICES",
