        "value": "Welcome to the Hampton Inn &amp;amp; Suites San Francisco-Burlingame-Airport South hotel in California. Our hotel is only one mile from the San Francisco International Airport and 12 miles from heart of downtown San Francisco. We are centrally located close to the San Francisco financial district, Monster Park, SBC Park and Cow Palace.  In Burlingame, the hotel provides complimentary shuttle service to and from the airport. We are only a mile away from the Subway Transit that can take guests to the financial district and downtown San Francisco.   Our first class AAA approved 3 diamond hotel serves complimentary hot breakfast daily with freshly baked biscuits, scrambled eggs, and sausage. Enjoy seasonal fresh cut fruits, a variety of pastries, assorted cereals and gourmet coffee.  Our California hotel is a perfect location with a beautiful bay view and walking distance to many restaurants.  The movie theater, jogging trails and picnic area makes our hotel an ideal choice for business or leisure California travelers. The Hampton Inn &amp;amp; Suites San Francisco hotel in Burlingame is only a five minute drive from a great golf course, major shopping mall and business parks.  For business or leisure travelers to California, our Hampton Inn &amp;amp; Suites hotel is connected with wireless high-speed internet access in the lobby and high-speed connections in all rooms.  While here, take advantage of our complimentary business center and fitness center. For your convenience, guestrooms have 2 phones with personalized voicemail, and an executive work desk with ergonomically designed chairs.  Experience our elegant style and modern decor surrounded by pleasant ambiance.  Hotel amenities and exceptional service makes our Burlingame hotel a perfect choice. We look forward to welcoming you soon.  We love having you here at the Hampton Inn &amp;amp; Suites San Francisco-Burlingame-Airport South hotel in California!"
